import photoAction from './photos/photoAction.png'
import photoFirst from './photos/photoFirst.png'
import photoPool from './photos/photoPool.png'
import photoRun from './photos/photoRun.png'
import photoSauna from './photos/photoSauna.png'
import photoSecond from './photos/photoSecond.png'
import photoThree from './photos/photoThree.png'
import photoYoga from './photos/photoYoga.png'
import styles from './photoSlider.module.css'

const photosGym = [
  photoAction,
  photoFirst,
  photoPool,
  photoRun,
  photoSauna,
  photoSecond,
  photoThree,
  photoYoga,
]

const PhotoGym = () => {
  return (
    <div className={styles}>
      {photosGym.map((img, index) => {
        return (
          <div key={index} className='sliderImg'>
            <img src={img} alt={'photoo of GYM ' + index} />
          </div>
        )
      })}
    </div>
  )
}

export default PhotoGym
